(1, 3, 'Kontak Kami', 'hubungi-kami', '<div class=\"jumbotron\">\r\n<h1>Hubungi Kami</h1>\r\n<p>Jika ada saran dan pertanyaan silahkan hubungi kami melalui:</p>\r\n<ul>\r\n<li>Alamat :&nbsp;Jalan Jenderal Sudirman nomor 84 B &ndash; Dumai Timur - Kota Dumai &ndash; Riau&nbsp;28814</li>\r\n<li>No. Telepon :&nbsp;082299395341 (WhatsApp)</li>\r\n<li>Email :&nbsp;<a href=\"mailto:pkbmhsprimaedukasi@gmail.com\">pkbmhsprimaedukasi@gmail.com</a></li>\r\n</ul>\r\n</div>', '0', '2020-03-07 15:28:06', '2020-07-06 08:44:21'),
(2, 2, 'Petunjuk', 'petunjuk', '<div class=\"jumbotron\">\r\n<p>Langkah-langkah melakuan pendaftaran Tes Diasnostik :</p>\r\n<ol>\r\n<li>Klik tombol \"Daftar Sekarang\"</li>\r\n<li>Lengkapi formulir yang tersedia</li>\r\n<li>Cek email untuk konfirmasi melalui email</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>Langkah-langkah melakukan Tes Diasnostik :</p>\r\n<ol>\r\n<li>Klik menu \"Login\"</li>\r\n<li>Masukkan&nbsp;NISN / username / email / telp dan password lalu klik tombol \"Sign In\"</li>\r\n<li>Setelah berhasil login, klik menu \"Mulai Tes\"</li>\r\n<li>Lalu klik tombol \"Kerjakan Sekarang\"</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n</div>', '0', '2020-03-09 13:08:41', '2020-07-06 08:40:59'),
(3, 1, 'Beranda', 'home', '<div class=\"jumbotron\">\r\n<h1>Homeschooling Prima Edukasi</h1>\r\n<p>halaman ini digunakan untuk memmbuat tampilan awal sistem sebelum peserta mendaftar</p>\r\n<p>&nbsp;</p>\r\n<p><a class=\"btn btn-primary btn-lg\" title=\"Daftar Sekarang\" href=\"/auth/register\" target=\"_blank\">Daftar Sekarang</a></p>\r\n<p>Jika sudah punya akun silahkan pilih <strong>menu login</strong>.</p>\r\n</div>', '0', '2020-03-09 13:10:13', '2020-07-05 08:05:36');
