(13, 4, '<p style=\"text-align: justify;\"><em>Bacalah dengan saksama !</em><br />Seorang anak yang baru lahir masih suci. Baik buruknya anak tersebut bergantung pada bagaimana cara orang tua mendidiknya, pengaruh orang-orang terdekat, dan lingkungannya. Kertas putih yang belum diberi goresan tak ubahnya seperti bayi, akan diberi goresan apa pada kertas itu bergantung kepada orang yang menggoreskannya. Jika orang itu pandai melukis, kertas itu akan menjadi lukisan yang bagus. Demikian juga dengan seorang anak &hellip; .<br />Kesimpulan yang tepat adalah &hellip; .</p>', '0', '2020-07-05 20:35:46', '2020-07-05 13:37:23'),
(14, 4, '<p style=\"text-align: justify;\"><em>Bacalah dengan saksama!</em><br />Kepergian sejumlah tokoh pada saat kita memasuki seabad kebangkitan nasional seakan membawa pesan untuk kembali bangkit. Negeri ini membutuhkan pelopor dan pejuang yang memiliki integritas moral, memegang teguh prinsip, memiliki keberanian melawan ketidakadilan, tidak korupsi, memiliki rasa cinta terhadap tanah air, dan mengutamakan perhatiannya terhadap perbaikan nasib rakyat kecil. Kepergian mereka seolah mengingatkan bahwa dewasa ini sifat-sifat itulah yang hilang dari kalangan elit bangsa kita saat ini. Karena itu, alih-alih kita bangkit dalam kehidupan dunia global yang semakin kompetitif sekarang ini, malah sebaliknya limbung sehingga mendekati ambruk. Meskipin demikian, kita tetap menaruh harap semoga para elit bangsa kita menyadari hal ini dan kembali menyulut api kebangkitan nasional sebelum padam.<br />Kesimpulan yang tepat adalah &hellip; .</p>', '0', '2020-07-05 20:36:59', '2020-07-05 13:36:59'),
(15, 4, '<p style=\"text-align: justify;\"><em>Bacalah dengan saksama!</em><br />Anak-anak memiliki kebutuhan tidur yang lebih banyak daripada orang dewasa. Hal ini dikarenakan anak-anak masih dalam masa pertumbuhan yang notabene membutuhkan banyak energi untuk terus tumbuh. Namun, secara umum kebutuhan tidur orang dewasa berkisar antara tujuh sampai delapan jam tiap hari. Hal itu terungkap dalam seminar kesehatan di Jakarta yang dihadiri oleh ratusan pendengar. Kebutuhan tidur sangat bervariasi pada setiap orang karena kebutuhan tidur dipengaruhi oleh tingkat aktivitas, umur, kodisi fisik, dan psikologis.<br />Kesimpulan yang tepat adalah &hellip; .</p>', '0', '2020-07-05 20:40:18', '2020-07-05 13:40:18'),
(16, 4, '<p style=\"text-align: justify;\"><em>Bacalah dengan saksama !</em><br />Bagi bangsa Indonesia, bahasa Indonesia merupakan simbol dan identitas kultural maupun politis yang menjadi rantai pengikat kuat dalam membangun kebersamaan sebagai sebuah komunitas di dalam keberanekaragaman kepentingan. Sebagai sebuah rantai pengikat, bahasa Indonesia yang dideklarasikan sebagai identitas tunggal kebahasaan telah teruji mampu mempersatukan beragam kepentingan dan latar belakang etnis maupun agama. Berdasarkan hal ini, sudah selayaknya revitalisasi penggunaan bahasa Indonesia melalui program pembelajaran di sekolah harus selalu ditingkatkan dari hari ke hari.<br />Kesimpulan yang tepat adalah &hellip; .</p>', '0', '2020-07-05 20:44:42', '2020-07-05 13:44:42'),
(17, 4, '<p style=\"text-align: justify;\"><em>Bacalah dengan saksama!</em><br />Siapa pun mengakui bahwa pendidikan di sekolah tidak bisa mengimbangi laju perkembangan ilmu pengetahuan dan teknologi serta informatika. Dalam keadaan seperti ini, sekolah sebagai salah satu lembaga yang ikut menyelenggarakan pendidikan berada dalam tarik-menarik dua kepentingan. Meski demikian sudah sepantasnya sekolah menanggapi situasi ini secara arif, agar tidak terseret ke dalam salah satu pendulum. Sekolah tidak boleh hanya berkutat pada upaya-upaya menyiapkan manusia berbudi luhur, menghargai keutamaan dan kebenaran di satu pihak. Di pihak lain sekolah juga tidak boleh larut hanya memenuhi tuntutan ekonomi pasar saja.<br />Kesimpulan yang tepat adalah ...</p>', '0', '2020-07-05 20:45:42', '2020-07-05 13:45:42'),
(18, 5, '<p>Semua menu sarapan diletakkan di meja makan. Nasi pecel diletakkan di meja dapur. Jadi, &hellip;.</p>', '0', '2020-07-05 20:51:50', '2020-07-05 13:51:50'),
(19, 5, '<p>Semua bunga berwarna cerah penyer-bukannya dibantu serangga. Sebagian bunga di taman berwarna cerah. Jadi, &hellip;</p>', '0', '2020-07-05 20:53:35', '2020-07-05 13:53:35'),
(20, 5, '<p style=\"text-align: justify;\">Semua siswa SMA diminta mempersiapkan diri untuk penilaian harian. Sebagian siswa SMA mendapat nilai baik dalam penilaian harian. Jadi, &hellip;</p>', '0', '2020-07-05 20:54:35', '2020-07-05 13:54:35'),
(21, 5, '<p style=\"text-align: justify;\">Semua kertas gambar sangat berguna. Sebagian kertas yang sangat berguna harganya murah.<br />Apakah kesimpulannya?</p>', '0', '2020-07-05 20:55:40', '2020-07-05 13:55:40'),
(22, 5, '<p style=\"text-align: justify;\">Pengurus koperasi seharusnya berjiwa sosial. Sebagian ketua RW pernah menjadi pengurus koperasi.<br />Apakah kesimpulannya?</p>', '0', '2020-07-05 20:56:49', '2020-07-05 13:56:49'),
(23, 5, '<p style=\"text-align: justify;\"><strong>Soal 26-28 berdasarkan informasi berikut.</strong><br /><em>Suatu keluarga memiliki beberapa cucu, di antaranya Anita, Berliana, Cahyo, David, dan yang lainnya. Anita lebih tua daripada Cahyo, dan Berliana lebih muda daripada David.</em></p>\r\n<p style=\"text-align: justify;\">Jika Berliana lebih muda daripada Cahyo, manakah pernyataan yang tidak benar?</p>', '0', '2020-07-05 20:58:18', '2020-07-05 14:03:09'),
(24, 5, '<p>Jika Erlina lebih tua daripada David, manakah pernyataan berikut yang benar?</p>', '0', '2020-07-05 20:59:34', '2020-07-05 13:59:34'),
(25, 5, '<p style=\"text-align: justify;\">Jika Intan lebih tua daripada Gadis, Halimah, dan Cahyo, manakah pernyataan berikut yang benar?</p>', '0', '2020-07-05 21:00:39', '2020-07-05 14:00:39'),
(26, 5, '<p style=\"text-align: justify;\"><strong>Soal 29 dan 30 berdasarkan informasi berikut.</strong><br /><em>Allisa berusia 16 tahun dan dua kali dari usia Deni. Gigih 9 tahun lebih tua daripada Deni dan 5 tahun lebih muda dari Hanna. Usia Tanto paling tua.</em></p>\r\n<p style=\"text-align: justify;\">Siapakah yang termuda?</p>', '0', '2020-07-05 21:01:56', '2020-07-05 14:01:56'),
(27, 5, '<p>Berapa selisih umur Gigih dan Allisa?</p>', '0', '2020-07-05 21:02:46', '2020-07-05 14:02:46'),
(28, 8, '<p style=\"text-align: justify;\">Saya suka bercerita, termasuk cerita do-ngeng dan cerita yang lucu.</p>', '0', '2020-07-05 22:15:42', '2020-07-05 15:15:42'),
(29, 8, '<p>Saya memiliki ingatan yang baik untuk hal-hal yang sepele.</p>', '0', '2020-07-05 22:17:25', '2020-07-05 16:41:01'),
(30, 8, '<p>Saya menyukai permainan kata-kata</p>', '0', '2020-07-05 22:18:56', '2020-07-05 15:18:56'),
(31, 8, '<p>Saya membaca buku hanya sebagai hobi.</p>', '0', '2020-07-05 22:22:01', '2020-07-05 15:22:01'),
(32, 8, '<p>Saya seorang pembicara yang baik (hampir setiap waktu).</p>', '0', '2020-07-05 22:25:05', '2020-07-05 15:25:05'),
(33, 8, '<p>Dalam berargumentasi, saya cenderung menggunakan kata-kata sindiran.</p>', '0', '2020-07-05 22:27:19', '2020-07-05 15:27:19'),
(34, 8, '<p>Saya senang membicarakan dan menulis ide-ide saya.</p>', '0', '2020-07-05 22:29:07', '2020-07-05 15:29:07'),
(35, 8, '<p>Jika saya harus mengingat sesuatu, saya menciptakan irama-irama atau kata-kata yang membantu saya untuk mengingatnya.</p>', '0', '2020-07-05 22:35:03', '2020-07-05 15:35:03'),
(36, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya akan membaca buku panduannya terlebih dahulu.</p>', '0', '2020-07-05 22:36:32', '2020-07-05 15:36:32'),
(37, 8, '<p>Dalam kerja kelompok (untuk menyiapkan sebuah presentasi), saya lebih memilih untuk menulis dan melakukan riset pustaka.</p>', '0', '2020-07-05 22:37:21', '2020-07-05 15:37:21'),
(38, 8, '<p>Saya sangat menikmati pelajaran mate-matika.</p>', '0', '2020-07-05 22:39:14', '2020-07-05 15:39:14'),
(39, 8, '<p>Saya menyukai permainan yang menggu-nakan logika, seperti teka teki angka.</p>', '0', '2020-07-05 22:43:12', '2020-07-05 15:43:12'),
(40, 8, '<p>Dapat memecahkan soal-soal hitungan adal-ah hal yang menyenangkan bagi saya.</p>', '0', '2020-07-05 22:44:12', '2020-07-05 15:44:12'),
(41, 8, '<p>Jika saya harus mengingat sesuatu, saya cenderung menempatkan setiap kejadian dalam urutan yang logis.</p>', '0', '2020-07-05 22:45:46', '2020-07-05 15:45:46'),
(42, 8, '<p>Saya senang mencari tahu bagaimana cara kerja setiap benda.</p>', '0', '2020-07-05 22:47:33', '2020-07-05 15:47:33'),
(43, 8, '<p>Saya menyukai komputer dan berbagai permainan angka-angka.</p>', '0', '2020-07-05 22:49:37', '2020-07-05 15:49:37'),
(44, 8, '<p>Saya suka bermain catur, checkers, atau monopol</p>', '0', '2020-07-05 22:57:22', '2020-07-05 15:57:22'),
(45, 8, '<p>Dalam berargumentasi, saya mencoba men-cari solusi yang adil dan logis.</p>', '0', '2020-07-05 22:59:46', '2020-07-05 15:59:46'),
(46, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya melihat bagian-bagiannya (atau komponen-komponennya) dan mencari tahu bagaimana cara kerjanya.</p>', '0', '2020-07-05 23:05:48', '2020-07-05 16:05:48'),
(47, 8, '<p>Dalam kerja kelompok, saya lebih memilih membuat diagram dan grafik.</p>', '0', '2020-07-05 23:07:12', '2020-07-05 16:07:12'),
(48, 8, '<p>Saya lebih memilih peta daripada petunjuk tertulis dalam mencari sebuah alamat.</p>', '0', '2020-07-05 23:08:26', '2020-07-05 16:08:26'),
(49, 8, '<p>Saya sering melamun.</p>', '0', '2020-07-05 23:10:11', '2020-07-05 16:10:11'),
(50, 8, '<p>Saya menikmati hobi saya dalam dalam bidang fotografi.</p>', '0', '2020-07-05 23:12:21', '2020-07-05 16:12:21'),
(51, 8, '<p>Saya senang menggambar dan menciptakan sesuatu.</p>', '0', '2020-07-05 23:14:06', '2020-07-05 16:14:06'),
(52, 8, '<p>Jika saya harus mengingat sesuatu, saya menggambar diagram untuk membantu saya mengingatnya.</p>', '0', '2020-07-05 23:15:13', '2020-07-05 16:15:13'),
(53, 8, '<p>Saya senang membuat coretan-coretan di kertas kapan pun saya bisa.</p>', '0', '2020-07-05 23:16:46', '2020-07-05 16:16:46'),
(54, 8, '<p>Ketika membaca majalah, saya lebih suka melihat gambar-gambarnya daripada mem-baca teksnya.</p>', '0', '2020-07-05 23:18:51', '2020-07-05 16:18:51'),
(55, 8, '<p>Dalam berargumentasi, saya mencoba menjaga jarak, tetap berdiam diri, atau memvisualisasikan beberapa solusi.</p>', '0', '2020-07-05 23:29:27', '2020-07-05 16:29:27'),
(56, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya cenderung mempelajari diagram mengenai cara kerjanya.</p>', '0', '2020-07-05 23:30:22', '2020-07-05 16:30:22'),
(57, 8, '<p>Dalam kerja kelompok, saya lebih memilih menggambar hal-hal yang penting.</p>', '0', '2020-07-05 23:40:14', '2020-07-05 16:40:14'),
(58, 8, '<p>Sejak suka berolahraga, senam menjadi olah raga favorit saya.</p>', '0', '2020-07-05 23:44:08', '2020-07-05 16:44:08'),
(59, 8, '<p>Saya menyukai kegiatan-kegiatan seperti pertukangan, menjahit dan membuat bentuk-bentuk.</p>', '0', '2020-07-05 23:45:36', '2020-07-05 16:45:36'),
(60, 8, '<p>Ketika melihat benda-benda, saya senang menyentuhnya.</p>', '0', '2020-07-05 23:46:48', '2020-07-05 16:46:48'),
(61, 8, '<p>Saya tidak dapat duduk diam dalam waktu yang lama.</p>', '0', '2020-07-05 23:47:19', '2020-07-05 16:47:19'),
(62, 8, '<p>Saya menggunakan banyak gerakan tubuh ketika berbicara.</p>', '0', '2020-07-05 23:47:50', '2020-07-05 16:47:50'),
(63, 8, '<p>Jika saya harus mengingat sesuatu, saya menuliskannya berkali-kali sampai saya memahaminya.</p>', '0', '2020-07-05 23:48:44', '2020-07-05 16:48:44'),
(64, 8, '<p>Saya cenderung mengetuk-ngetuk jari saya atau memainkan pena/pensil selama jam pelajaran.</p>', '0', '2020-07-05 23:49:40', '2020-07-05 16:49:40'),
(65, 8, '<p>Dalam berargumentasi,saya cenderung menyerang atau menghindarinya.</p>', '0', '2020-07-05 23:50:30', '2020-07-05 16:50:30'),
(66, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya cenderung memisahkan setiap bagian lalu menggabungkannya kembali.</p>', '0', '2020-07-05 23:51:30', '2020-07-05 16:51:30'),
(67, 8, '<p>Dalam kerja kelompok, saya lebih memilih memindahkan barang atau membuat suatu bentuk.</p>', '0', '2020-07-05 23:52:24', '2020-07-05 16:52:24'),
(68, 8, '<p>Saya senang mendengarkan musik dan radio.</p>', '0', '2020-07-05 23:52:48', '2020-07-05 16:52:48'),
(69, 8, '<p>Saya cenderung bersenandung ketika sedang bekerja.</p>', '0', '2020-07-05 23:53:54', '2020-07-05 16:53:54'),
(70, 8, '<p>Saya suka bernyanyi.</p>', '0', '2020-07-05 23:54:12', '2020-07-05 16:54:12'),
(71, 8, '<p>Saya bisa memainkan salah satu alat musik dengan baik.</p>', '0', '2020-07-05 23:54:32', '2020-07-05 16:54:32'),
(72, 8, '<p>Saya suka mendengarkan musik sambil belajar atau sambil membaca buku.</p>', '0', '2020-07-05 23:54:55', '2020-07-05 16:54:55'),
(73, 8, '<p>Jika saya harus mengingat sesuatu, saya mencoba untuk membuat irama tentang hal tersebut.</p>', '0', '2020-07-05 23:55:18', '2020-07-05 16:55:18'),
(74, 8, '<p>Dalam berargumentasi, saya cenderung berteriak atau memukul (meja/ benda) atau bergerak dalam suatu irama.</p>', '0', '2020-07-05 23:55:43', '2020-07-05 16:55:43'),
(75, 8, '<p>Saya bisa menghafal nada-nada dari banyak lagu.</p>', '0', '2020-07-05 23:56:26', '2020-07-05 16:56:26'),
(76, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya cenderung mengetuk-ngetuk jari saya membentuk suatu irama sambil mencari jalan keluar.</p>', '0', '2020-07-05 23:56:50', '2020-07-05 16:56:50'),
(77, 8, '<p>Dalam kerja kelompok, saya lebih suka menggunakan kata-kata baru pada nada atau musik yang sudah dikenal.</p>', '0', '2020-07-05 23:57:49', '2020-07-05 16:57:49'),
(78, 8, '<p>Saya mampu bergaul baik dengan orang lain.</p>', '0', '2020-07-05 23:58:07', '2020-07-05 16:58:07'),
(79, 8, '<p>Saya senang berkumpul dan berorganisasi.</p>', '0', '2020-07-05 23:58:45', '2020-07-05 16:58:45'),
(80, 8, '<p>Saya mempunyai beberapa teman dekat.</p>', '0', '2020-07-05 23:59:06', '2020-07-05 16:59:06'),
(81, 8, '<p>Saya suka membantu mengajar murid-murid lain.</p>', '0', '2020-07-05 23:59:31', '2020-07-05 16:59:31'),
(82, 8, '<p>Saya senang bekerja sama dalam kelompok.</p>', '0', '2020-07-06 00:00:16', '2020-07-05 17:00:16'),
(83, 8, '<p>Teman-teman sering meminta saran dari saya karena saya terlihat sebagai pemimpin alamiah.</p>', '0', '2020-07-06 00:00:55', '2020-07-05 17:00:55'),
(84, 8, '<p>Jika saya harus mengingat sesuatu, saya meminta seseorang untuk menguji saya apakah saya sudah memahaminya.</p>', '0', '2020-07-06 00:01:14', '2020-07-05 17:01:14'),
(85, 8, '<p>Dalam berargumentasi, saya cenderung meminta bantuan teman atau pihak- pihak yang memiliki otoritas (ahli) dalam bidang tersebut.</p>', '0', '2020-07-06 00:01:56', '2020-07-05 17:01:56'),
(86, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya mencari seseorang yang dapat menolong saya.</p>', '0', '2020-07-06 00:03:06', '2020-07-05 17:03:06'),
(87, 8, '<p>Dalam kerja kelompok, saya lebih memilih mengatur tugas dalam kelompok.</p>', '0', '2020-07-06 00:03:23', '2020-07-05 17:03:23'),
(88, 8, '<p>Saya suka bekerja sendirian tanpa ada gangguan orang lain.</p>', '0', '2020-07-06 00:05:04', '2020-07-05 17:05:04'),
(89, 8, '<p>Saya suka menulis buku harian.</p>', '0', '2020-07-06 00:05:22', '2020-07-05 17:05:22'),
(90, 8, '<p>Saya menyukai diri saya (hampir setiap waktu).</p>', '0', '2020-07-06 00:05:42', '2020-07-05 17:05:42'),
(91, 8, '<p>Saya tidak suka keramaian.</p>', '0', '2020-07-06 00:06:02', '2020-07-05 17:06:02'),
(92, 8, '<p>Saya tahu kelebihan dan kekurangan diri saya.</p>', '0', '2020-07-06 00:06:19', '2020-07-05 17:06:19'),
(93, 8, '<p>Saya memiliki tekad yang kuat, mandiri dan berpendirian kuat (tidak mudah ikut-ikutan orang lain).</p>', '0', '2020-07-06 00:07:11', '2020-07-05 17:07:11'),
(94, 8, '<p>Jika saya harus mengingat sesuatu saya cenderung menutup mata saya dan mendalami (merasakan) situasi yang sedang terjadi.</p>', '0', '2020-07-06 00:07:31', '2020-07-05 17:07:31'),
(95, 8, '<p>Dalam berargumentasi, saya biasanya menghindar (keluar ruangan) hingga saya dapat menenangkan diri.</p>', '0', '2020-07-06 00:08:08', '2020-07-05 17:08:08'),
(96, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya mempertimbangkan apakah benda tersebut layak untuk diperbaiki.</p>', '0', '2020-07-06 00:08:53', '2020-07-05 17:08:53'),
(97, 8, '<p>Dalam kerja kelompok, saya senang mengkontribusikan sesuatu yang unik berdasarkan apa yang saya miliki dan rasakan.</p>', '0', '2020-07-06 00:10:00', '2020-07-05 17:10:00'),
(98, 8, '<p>Saya sangat memperhatikan sekeliling dan apa yang sedang terjadi di sekitar saya.</p>', '0', '2020-07-06 00:11:10', '2020-07-05 17:11:10'),
(99, 8, '<p>Saya senang berjalan-jalan di hutan (atau taman) dan melihat-lihat pohon serta bunga.</p>', '0', '2020-07-06 00:11:29', '2020-07-05 17:11:29'),
(100, 8, '<p>Saya senang berkebun.</p>', '0', '2020-07-06 00:11:50', '2020-07-05 17:11:50'),
(101, 8, '<p>Saya suka mengoleksi barang-barang seperti batu-batuan, kartu olahraga, perangko, dsb.</p>', '0', '2020-07-06 00:12:38', '2020-07-05 17:12:38'),
(102, 8, '<p>Ketika dewasa, saya ingin pergi dari kota yang ramai ke tempat yang masih alamiah untuk menikmati alam.</p>', '0', '2020-07-06 00:13:00', '2020-07-05 17:13:00'),
(103, 8, '<p>Jika saya harus mengingat sesuatu, saya cenderung mengkategorikannya dalam kelompok-kelompok.</p>', '0', '2020-07-06 00:13:46', '2020-07-05 17:13:46'),
(104, 8, '<p>Saya senang mempelajari nama-nama makhluk hidup di lingkungan tempat saya berada, seperti bunga dan pohon.</p>', '0', '2020-07-06 00:14:03', '2020-07-05 17:14:03'),
(105, 8, '<p>Dalam berargumentasi, saya cenderung membandingkan lawan saya dengan seseorang atau sesuatu yang pernah saya baca atau dengar lalu bereaksi.</p>', '0', '2020-07-06 00:14:20', '2020-07-05 17:14:20'),
(106, 8, '<p>Jika sesuatu rusak dan tidak berfungsi, saya memperhatikan sekeliling saya untuk melihat apa yang bisa saya temukan untuk memperbaikinya.</p>', '0', '2020-07-06 00:15:01', '2020-07-05 17:15:01'),
(107, 8, '<p>Dalam kerja kelompok, saya lebih memilih mengatur dan mengelompokkan informasi dalam kategori-kategori sehingga mudah dimengerti.</p>', '0', '2020-07-06 00:15:55', '2020-07-05 17:15:55'),
